  //       .then(response => response.json())
  //       .then(data => resolve(data))
  //       .catch(function(err) {
  //         console.log("Fetch Error :-S", err);
  //       });
  //   });

  // }
  // function apiGet(method, query) {
  //   return new Promise(function (resolve, reject) {
  //     var otmAPI =
  //       "https://api.opentripmap.com/0.1/en/places/" +
  //       method +
  //       "?apikey=" +
  //       apiKey;
  //     if (query !== undefined) {
  //       otmAPI += "&" + query;
  //     }
  //     fetch(otmAPI)
  //       .then((response) => response.json())
  //       .then((data) => resolve(data))
  //       .catch(function (err) {
  //         console.log("Fetch Error :-S", err);
  //       });
  //   });
  // }

  // useEffect(() => {
  //   // Example usage of apiGet
  //   apiGet("method_name", "query_string")
  //     .then((data) => {
  //       // Handle the API response
  //       console.log(data);
  //     })
  //     .catch((error) => {
  //       // Handle any errors
  //       console.log(error);
  //     });
  // }, []);
  const [data, setData] = useState();

  useEffect(() => {
    const getData = async () => {
      const apiKey =
        "08055d42b197991a23c1c937accab7c631deffc59e10db04c83327dc104833cc";
      const url = `http://localhost:8010/proxy/search.json?engine=google&q=Maldives+Destinations&api_key=${apiKey}`;

      try {
        const response = await axios.get(url);
        setData(response?.data);
      } catch (error) {
        console.log(error);
      }
    };
    console.log(data);
    getData();
  }, []);
  return (
    <>
      {/* <div className={s.BpkCard}>
        <div className={s.BpkImage}>
          <img src={image} className={s.image} />
        </div>
        <div className={s.InternalLinkCard}>
          <div className={s.InternalLinkTitle}>{title}</div>
          <div className={s.priceTitle}>

            <button className={s.buttonSelect} 
            // onChange={onButtonPress}

            >Read</button>
          </div>
        </div>
      </div> */}
      {/* <div>Select</div> */}
      <div>
      {/* <img src={data?.inline_images?.[0].original} style={{width: "200px", height: "200px"}}/> */}
      <p>Main information</p>
      <p>Capital is {data?.knowledge_graph?.capital}</p>
      <p>{data?.knowledge_graph?.description}</p>
      <p>{data?.knowledge_graph?.gdp_growth_rate_links?.[0]?.text} is {data?.knowledge_graph?.gdp_growth_rate}</p>
      <p>{data?.knowledge_graph?.gdp_per_capita_links?.[0]?.text} is {data?.knowledge_graph?.gdp_per_capita}</p>
      <p>{data?.knowledge_graph?.gross_domestic_product_links?.[0]?.text} is {data?.knowledge_graph?.gross_domestic_product}</p>
      <p>Popular Destinations</p>
      <p>{data?.popular_destinations?.destinations?.[0]?.title}</p>
      <p>{data?.popular_destinations?.destinations?.[0]?.description}</p>
      <p>{data?.popular_destinations?.destinations?.[0]?.flight_duration}</p>
      <p>{data?.popular_destinations?.destinations?.[0]?.flight_price}</p>
      <img src={data?.popular_destinations?.destinations?.[0]?.thumbnail} />

      <p>{data?.popular_destinations?.destinations?.[1]?.title}</p>
      <p>{data?.popular_destinations?.destinations?.[1]?.description}</p>
      <p>{data?.popular_destinations?.destinations?.[1]?.flight_duration}</p>
      <p>{data?.popular_destinations?.destinations?.[1]?.flight_price}</p>
      <img src={data?.popular_destinations?.destinations?.[1]?.thumbnail} />


      <p>{data?.popular_destinations?.destinations?.[2]?.title}</p>
      <p>{data?.popular_destinations?.destinations?.[2]?.description}</p>
      <p>{data?.popular_destinations?.destinations?.[2]?.hotel_price}</p>
      <img src={data?.popular_destinations?.destinations?.[2]?.thumbnail} />
      <p>Questions</p>

      <p>{data?.related_questions?.[0]?.question}</p>
      <li>{data?.related_questions?.[0]?.list?.[0]}</li>
      <li>{data?.related_questions?.[0]?.list?.[1]}</li>
      <li>{data?.related_questions?.[0]?.list?.[2]}</li>
      <li>{data?.related_questions?.[0]?.list?.[3]}</li>
      <li>{data?.related_questions?.[0]?.list?.[4]}</li>
      <li>{data?.related_questions?.[0]?.list?.[5]}</li>

      <p>{data?.related_questions?.[1]?.question}</p>
      <p>{data?.related_questions?.[1]?.snippet}</p>
      <p>{data?.related_questions?.[2]?.question}</p>
      <p>{data?.related_questions?.[2]?.snippet}</p>
      <p>{data?.related_questions?.[3]?.question}</p>
      <p>{data?.related_questions?.[3]?.snippet}</p>

      <p>{data?.inline_images?.[0]?.title}</p>
      <img src={data?.inline_images?.[0]?.original} style={{width: "200px", height: "150px"}}/>
      <br></br>
      <a href={data?.inline_images?.[0]?.link}>Link</a>
      <p>{data?.inline_images?.[1]?.title}</p>
      <img src={data?.inline_images?.[1]?.original} style={{width: "200px", height: "150px"}}/>
      <br></br>
      <a href={data?.inline_images?.[1]?.link}>Link</a>
      <p>{data?.inline_images?.[2]?.title}</p>
      <img src={data?.inline_images?.[2]?.original} style={{width: "200px", height: "150px"}}/>
      <br></br>
      <a href={data?.inline_images?.[2]?.link}>Link</a>
      <p>{data?.inline_images?.[3]?.title}</p>
      <img src={data?.inline_images?.[3]?.original} style={{width: "200px", height: "150px"}}/>
      <br></br>
      <a href={data?.inline_images?.[3]?.link}>Link</a>
      <p>{data?.inline_images?.[4]?.title}</p>
      <img src={data?.inline_images?.[4]?.original} style={{width: "200px", height: "150px"}}/>
      <br></br>
      <a href={data?.inline_images?.[4]?.link}>Link</a>
    </div>
    </>
  );
}
export default PlacesLink;

